  "extends": "./common-tsconfig.json",
  "compilerOptions": {
    "allowJs": true,
    "strict": true,
    "incremental": true,
    "isolatedModules": true,
    "noEmit": true,
    "jsx": "react"
  },
  "exclude": ["**/node_modules", "../enterprise", "./packages/api-client"]
}
